import React from 'react';
import PopupWithForm from './PopupWithForm';

function DeleteCardPopup({card, isOpen, onClose, onDeleteSubmit}) {

    function handleDeleteSubmit() {
        console.log(card);
        onDeleteSubmit(card);
      }

    return (
        <PopupWithForm 
          classs='delete-card' 
          name='delete-confirmation' 
          title='Вы уверены?' 
          submitText='Да' 
          isOpen={isOpen}
          onClose={onClose}
          onSubmit={handleDeleteSubmit}>
        </PopupWithForm>
    );
  }

  export default DeleteCardPopup;
